    const handleSearch = async (term) => {
      const photos = await searchPhotos(term);
      setImages(photos);
    };
    useEffect(async () => {
      const photos = await getAllPhotos();
      setImages(photos);
    }, []);
  return (
    <>
     <SearchBar functionSearchParent={handleSearch}/>
     <ImageList images={images}/>
